Objectives / Expected Outcomes:
RSS will design and develop a marketables release that will build on the new Core Framework to improve our customers’ ability to access and manage their marketables securities portfolio from multiple devices. The success of this investment will be measured by accomplishing RSS tactical plan priorities and milestone/activity results,and:
• increasing customer self-sufficiency; 
• simplifying customer service support due to the new self-service features and the securities portfolio view;
• moving the issuance of complex securities off of an aging infrastructure; and
• complementing an ISS Tactical Plan Activity to move applications off of the BPD Framework.

